import React from "react";
import "./Table.css";

function Table(props) {

  const tableRows = props?.tableData.map((rowData, index) => (
    <tr key={index}>
      {rowData.map((cellData, cellIndex) => (
        <td
          key={`${index}-${cellIndex}`}
          onDrop={props.onDrop}
          onDragOver={props.onDragOver}
        >
          {cellData}

        </td>
      ))}
    </tr>
  ));

  return (
    <div>
      <table>
        <thead>
          {tableRows[0]}
        </thead>
        <tbody>
          {tableRows.slice(1)}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
